import React from "react";
import "./Nav.css";
import taxMapLogo from "../../assets/images/taxmap-official-logo.png";
function Nav() {
  return (
    <div>
      {/* NavBar*/}
      <div className="nav_bar">
        <img src={taxMapLogo} alt="taxMapLogo"></img>
      </div>
    </div>
  );
}

export default Nav;
